// src/components/MainApp.js
import React, { useState } from 'react';
import { LogOut, Camera, Image, Sparkles, Upload, Activity, Settings, User } from 'lucide-react';
import authService from '../services/authService';
import SessionPage from './SessionPage';

const HomePage = ({ user, onSignOut }) => {
  const [activeView, setActiveView] = useState('dashboard'); // 'dashboard' or 'session'
  const [activeTab, setActiveTab] = useState('dashboard');

  const handleSignOut = async () => {
    try {
      await authService.signOut();
      onSignOut();
    } catch (error) {
      console.error('Sign out error:', error);
      alert('Error signing out. Please try again.');
    }
  };

  const handleStartSession = () => {
    setActiveView('session');
  };

  const handleBackToDashboard = () => {
    setActiveView('dashboard');
  };

  // If in session view, show SessionPage
  if (activeView === 'session') {
    return <SessionPage user={user} onSignOut={handleBackToDashboard} />;
  }

  // Otherwise show the dashboard
  return (
    <div className="min-h-screen bg-gradient-to-br from-indigo-50 via-white to-purple-50">
      {/* Navigation Bar */}
      <nav className="bg-white shadow-md">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between items-center h-16">
            <div className="flex items-center space-x-3">
              <Camera className="h-8 w-8 text-indigo-600" />
              <h1 className="text-2xl font-bold text-gray-900">Vision AI</h1>
            </div>

            {/* Navigation Tabs */}
            <div className="hidden md:flex space-x-4">
              <button
                onClick={() => setActiveTab('dashboard')}
                className={`px-4 py-2 rounded-lg transition duration-200 ${
                  activeTab === 'dashboard'
                    ? 'bg-indigo-100 text-indigo-700 font-semibold'
                    : 'text-gray-600 hover:bg-gray-100'
                }`}
              >
                Dashboard
              </button>
              <button
                onClick={() => setActiveTab('upload')}
                className={`px-4 py-2 rounded-lg transition duration-200 ${
                  activeTab === 'upload'
                    ? 'bg-indigo-100 text-indigo-700 font-semibold'
                    : 'text-gray-600 hover:bg-gray-100'
                }`}
              >
                Upload
              </button>
              <button
                onClick={() => setActiveTab('activity')}
                className={`px-4 py-2 rounded-lg transition duration-200 ${
                  activeTab === 'activity'
                    ? 'bg-indigo-100 text-indigo-700 font-semibold'
                    : 'text-gray-600 hover:bg-gray-100'
                }`}
              >
                Activity
              </button>
              <button
                onClick={() => setActiveTab('settings')}
                className={`px-4 py-2 rounded-lg transition duration-200 ${
                  activeTab === 'settings'
                    ? 'bg-indigo-100 text-indigo-700 font-semibold'
                    : 'text-gray-600 hover:bg-gray-100'
                }`}
              >
                Settings
              </button>
            </div>

            {/* User Info & Sign Out */}
            <div className="flex items-center space-x-4">
              <div className="hidden sm:flex items-center space-x-2 text-sm text-gray-700 bg-gray-100 px-3 py-2 rounded-lg">
                <User className="h-4 w-4 text-indigo-600" />
                <span className="font-medium">{user?.username || 'User'}</span>
              </div>
              <button
                onClick={handleSignOut}
                className="flex items-center space-x-2 px-4 py-2 bg-red-500 text-white rounded-lg hover:bg-red-600 transition duration-200 shadow-md hover:shadow-lg"
              >
                <LogOut className="h-4 w-4" />
                <span>Sign Out</span>
              </button>
            </div>
          </div>

          {/* Mobile Navigation */}
          <div className="md:hidden flex space-x-2 pb-3 overflow-x-auto">
            <button
              onClick={() => setActiveTab('dashboard')}
              className={`px-3 py-1.5 rounded-lg text-sm whitespace-nowrap transition duration-200 ${
                activeTab === 'dashboard'
                  ? 'bg-indigo-100 text-indigo-700 font-semibold'
                  : 'text-gray-600 hover:bg-gray-100'
              }`}
            >
              Dashboard
            </button>
            <button
              onClick={() => setActiveTab('upload')}
              className={`px-3 py-1.5 rounded-lg text-sm whitespace-nowrap transition duration-200 ${
                activeTab === 'upload'
                  ? 'bg-indigo-100 text-indigo-700 font-semibold'
                  : 'text-gray-600 hover:bg-gray-100'
              }`}
            >
              Upload
            </button>
            <button
              onClick={() => setActiveTab('activity')}
              className={`px-3 py-1.5 rounded-lg text-sm whitespace-nowrap transition duration-200 ${
                activeTab === 'activity'
                  ? 'bg-indigo-100 text-indigo-700 font-semibold'
                  : 'text-gray-600 hover:bg-gray-100'
              }`}
            >
              Activity
            </button>
            <button
              onClick={() => setActiveTab('settings')}
              className={`px-3 py-1.5 rounded-lg text-sm whitespace-nowrap transition duration-200 ${
                activeTab === 'settings'
                  ? 'bg-indigo-100 text-indigo-700 font-semibold'
                  : 'text-gray-600 hover:bg-gray-100'
              }`}
            >
              Settings
            </button>
          </div>
        </div>
      </nav>

      {/* Main Content Area */}
      <main className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        {activeTab === 'dashboard' && <DashboardTab user={user} onStartSession={handleStartSession} />}
        {activeTab === 'upload' && <UploadTab />}
        {activeTab === 'activity' && <ActivityTab />}
        {activeTab === 'settings' && <SettingsTab user={user} />}
      </main>
    </div>
  );
};

// Dashboard Tab Component
const DashboardTab = ({ user, onStartSession }) => (
  <div>
    <div className="mb-8">
      <h2 className="text-3xl font-bold text-gray-900 mb-2">
        Welcome back, {user?.username}! ðŸ‘‹
      </h2>
      <p className="text-gray-600">Your AI-powered image analysis dashboard</p>
    </div>

    {/* Start Session Button */}
    <div className="mb-8">
      <button
        onClick={onStartSession}
        className="px-6 py-3 bg-blue-600 text-white font-semibold rounded-lg hover:bg-blue-700 transition shadow-lg"
      >
        Start New Session
      </button>
    </div>

    {/* Stats Grid */}
    <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mb-8">
      <StatCard
        title="Total Images"
        value="0"
        icon={Image}
        color="indigo"
      />
      <StatCard
        title="Processed"
        value="0"
        icon={Sparkles}
        color="purple"
      />
      <StatCard
        title="Active Sessions"
        value="1"
        icon={Activity}
        color="green"
      />
    </div>

    {/* Feature Cards */}
    <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
      <FeatureCard
        icon={Image}
        title="Image Upload"
        description="Upload and process images with advanced AI algorithms"
        color="indigo"
      />
      <FeatureCard
        icon={Sparkles}
        title="AI Analysis"
        description="Get instant insights powered by machine learning"
        color="purple"
      />
      <FeatureCard
        icon={Camera}
        title="Real-time Processing"
        description="Fast and efficient image processing in real-time"
        color="green"
      />
    </div>
  </div>
);

// Reusable Stat Card Component
const StatCard = ({ title, value, icon: Icon, color }) => {
  const colorClasses = {
    indigo: 'border-indigo-500 text-indigo-500',
    purple: 'border-purple-500 text-purple-500',
    green: 'border-green-500 text-green-500',
  };

  return (
    <div className={`bg-white rounded-xl shadow-lg p-6 border-l-4 ${colorClasses[color]}`}>
      <div className="flex items-center justify-between">
        <div>
          <p className="text-sm text-gray-500 uppercase tracking-wide">{title}</p>
          <p className="text-3xl font-bold text-gray-900 mt-1">{value}</p>
        </div>
        <Icon className={`h-12 w-12 ${colorClasses[color]} opacity-50`} />
      </div>
    </div>
  );
};

// Reusable Feature Card Component
const FeatureCard = ({ icon: Icon, title, description, color }) => {
  const colorClasses = {
    indigo: 'bg-indigo-100 text-indigo-600',
    purple: 'bg-purple-100 text-purple-600',
    green: 'bg-green-100 text-green-600',
  };

  return (
    <div className="bg-white rounded-xl shadow-lg p-6 hover:shadow-xl transition duration-300 cursor-pointer">
      <div className={`flex items-center justify-center h-16 w-16 rounded-full ${colorClasses[color]} mx-auto mb-4`}>
        <Icon className="h-8 w-8" />
      </div>
      <h3 className="text-xl font-bold text-gray-900 text-center mb-2">
        {title}
      </h3>
      <p className="text-gray-600 text-center">
        {description}
      </p>
    </div>
  );
};

// Upload Tab Component
const UploadTab = () => (
  <div>
    <h2 className="text-3xl font-bold text-gray-900 mb-6">Upload Images</h2>

    <div className="bg-white rounded-xl shadow-lg p-8">
      <div className="border-2 border-dashed border-gray-300 rounded-lg p-12 text-center hover:border-indigo-500 transition duration-300 cursor-pointer">
        <Upload className="h-16 w-16 text-gray-400 mx-auto mb-4" />
        <h3 className="text-xl font-semibold text-gray-900 mb-2">
          Drop your images here
        </h3>
        <p className="text-gray-600 mb-4">
          or click to browse from your computer
        </p>
        <button className="px-6 py-3 bg-indigo-600 text-white rounded-lg hover:bg-indigo-700 transition duration-200">
          Select Files
        </button>
      </div>

      <div className="mt-6">
        <p className="text-sm text-gray-500">
          Supported formats: JPG, PNG, GIF (Max size: 10MB)
        </p>
      </div>
    </div>

    <div className="mt-8 bg-indigo-50 rounded-lg p-6">
      <p className="text-indigo-800 font-medium text-center">
        ðŸš€ Image upload functionality coming soon! This will integrate with S3 for storage.
      </p>
    </div>
  </div>
);

// Activity Tab Component
const ActivityTab = () => (
  <div>
    <h2 className="text-3xl font-bold text-gray-900 mb-6">Recent Activity</h2>

    <div className="bg-white rounded-xl shadow-lg p-8">
      <div className="text-center py-12">
        <Activity className="h-16 w-16 text-gray-300 mx-auto mb-4" />
        <h3 className="text-xl font-semibold text-gray-900 mb-2">
          No activity yet
        </h3>
        <p className="text-gray-600">
          Your image processing history will appear here
        </p>
      </div>
    </div>
  </div>
);

// Settings Tab Component
const SettingsTab = ({ user }) => (
  <div>
    <h2 className="text-3xl font-bold text-gray-900 mb-6">Account Settings</h2>

    <div className="bg-white rounded-xl shadow-lg p-8">
      <div className="space-y-6">
        <div className="border-b pb-6">
          <h3 className="text-xl font-bold text-gray-900 mb-4">Profile Information</h3>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-2">
                Username
              </label>
              <input
                type="text"
                value={user?.username || 'N/A'}
                disabled
                className="w-full px-4 py-2 border border-gray-300 rounded-lg bg-gray-50 text-gray-700"
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-2">
                User ID
              </label>
              <input
                type="text"
                value={user?.userId || 'N/A'}
                disabled
                className="w-full px-4 py-2 border border-gray-300 rounded-lg bg-gray-50 text-gray-700"
              />
            </div>
          </div>
        </div>

        <div className="border-b pb-6">
          <h3 className="text-xl font-bold text-gray-900 mb-4">Preferences</h3>
          <div className="space-y-3">
            <label className="flex items-center space-x-3 cursor-pointer">
              <input type="checkbox" className="form-checkbox h-5 w-5 text-indigo-600" />
              <span className="text-gray-700">Email notifications</span>
            </label>
            <label className="flex items-center space-x-3 cursor-pointer">
              <input type="checkbox" className="form-checkbox h-5 w-5 text-indigo-600" defaultChecked />
              <span className="text-gray-700">Auto-process images</span>
            </label>
            <label className="flex items-center space-x-3 cursor-pointer">
              <input type="checkbox" className="form-checkbox h-5 w-5 text-indigo-600" />
              <span className="text-gray-700">Dark mode</span>
            </label>
          </div>
        </div>

        <div>
          <button className="px-6 py-3 bg-indigo-600 text-white rounded-lg hover:bg-indigo-700 transition duration-200">
            Save Changes
          </button>
        </div>
      </div>
    </div>
  </div>
);

export default HomePage;
